import axios from "axios";

const ApiRequest = {
  Session: {
    Login: (params) => {
      return async (dispatch) => {
        try {
          axios
            .post('https://dev.perseo.tv/ws/Login.php', {
              params: {
                user: 'sdf',
                pass: 'dsf',
                device: 'web'
              },
            })
            .then(res => {


              //console.log(res);
            });
        } catch (err) {
          console.log(err)
        }
      };
    }
  }
}

export default ApiRequest;
